script: |
  super -f text -I q566.spq | sort > q566.out

inputs:
  - name: q566.spq
    data: |
      SELECT DISTINCT - cor0.col2 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col2 IN ( cor0.col1 * + cor0.col0 );
  - name: tab0

outputs:
  - name: q566.out
    data: |
      -1
      -33
      -82
